import React from "react";
import { Navbar, NavbarBrand, Container } from "react-bootstrap";

class Footer extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="fixed-bottom bg-success" >  
            <Navbar color="dark" dark >
                <Container>
                    <NavbarBrand className="h6" >Desarrollado por Mart√≠n Madridejos</NavbarBrand>
                </Container>
            </Navbar>
        </div>
      </React.Fragment>
    );
  }
}

export default Footer;
